import React, { useState } from 'react'

export default function Range() {
    const [value,setValue] = useState(3)

    const handleChange = (ev) => {
        setValue(parseInt(ev.target.value)); // Parse the value to a number
      };
  return (
    <div>
    <form>
      <input type='range'
      name='range2'
      min={0}
      max={50}
      step={1}
      value={value}
      onChange={(ev)=>{
        setValue(ev.target.value)
      }}></input><label>this is input</label>
      <input type='range'
      name='range1'
      min={0}
      max={50}
      step={1}
      value={value}
      onChange={handleChange}></input><label>this is input</label>
      </form>
    </div>
  )
}
